class Image(val imageData: ByteArray, val palette: Palette, val desiredSize: Point2D, val originalSize: Point2D) {
    fun get16ColorImage(transparency: Boolean): BufferedImage  {
        val image  = BufferedImage(originalSize.x.toInt(), originalSize.y.toInt(), BufferedImage.TYPE_INT_ARGB)
        var x = -1
        var y = 0
        var blockx = 0
        var blocky = 0
        for (i in 0 until imageData.size * 2) {
            x++
            if (x >= 8) {
                x = 0
                y++
            }
            if (y >= 8) {
                y = 0
                blockx++
            }
            if (blockx > image.width / 8 - 1) {
                blockx = 0
                blocky++
            }

            var pal = imageData[i / 2].toPositiveInt()
            if ((i and 1) == 0)
                pal = pal and 0xF
            else
                pal = (pal and 0xF0) shr 4

            image.raster.setPixel(x + blockx * 8, y + blocky * 8, intArrayOf(palette.reds[pal].toPositiveInt(), palette.greens[pal].toPositiveInt(), palette.blues[pal].toPositiveInt(), if (transparency && pal == 0) 0 else 255))
        }

        return image
    }

    fun get16ColorImageCopy(transparency: Boolean): BufferedImage {
        val im = BufferedImage(this.originalSize.x.toInt(), this.originalSize.y.toInt(), BufferedImage.TYPE_INT_ARGB)
        var x = -1
        var y = 0
        var blockx = 0
        var blocky = 0

        for (i in 0 until this.imageData.size * 2) {
            ++x
            if (x >= 8) {
                x = 0
                ++y
            }

            if (y >= 8) {
                y = 0
                ++blockx
            }

            if (blockx > im.width / 8 - 1) {
                blockx = 0
                ++blocky
            }

            var pal = this.imageData[i / 2].toPositiveInt()
            if (i and 1 == 0) {
                pal = pal and 15
            } else {
                pal = pal and 240 shr 4
            }

            try {
                im.raster.setPixel(x + blockx * 8, y + blocky * 8, intArrayOf(palette.reds[pal].toPositiveInt(), palette.greens[pal].toPositiveInt(), palette.blues[pal].toPositiveInt(), if (transparency && pal == 0) 0 else 255))
            } catch (var11: Exception) {
                println("out of bounds: ")
                println("x: ${x + blockx * 8}")
                println("y: ${y + blocky * 8}")
            }

        }

        return im
    }

}

enum class ImageType {
    Palette16Color,
    Palette256Color
}

class Palette(type: ImageType, paletteData: ByteArray) {
    val colors: Array<Color>
    val reds: ByteArray
    val greens: ByteArray
    val blues: ByteArray

    init {
        if (type == ImageType.Palette16Color) {
            colors = Array(16, {Color.WHITE})
            reds = ByteArray(16)
            greens = ByteArray(16)
            blues = ByteArray(16)
        } else {
            colors = Array(256, {Color.WHITE})
            reds = ByteArray(256)
            greens = ByteArray(256)
            blues = ByteArray(256)
        }

        for (i in 0 until paletteData.size step 2) {
            val color = paletteData.slice(i..i+1)
                    .toByteArray().toIntArray()
                    .toLong()
            //println("C" + color)
            val r = ((color and 0x1F) shl 3).toInt()
            val g = ((color and 0x3E0) shr 2).toInt()
            val b = ((color and 0x7C00) shr 7).toInt()
            reds[i/2] = r.toByte()
            greens[i/2] = g.toByte()
            blues[i/2] = b.toByte()
            //println("R" + r)
            //println("G" + g)
            //println("B" + b)
            colors[i/2] = Color(r, g, b)
        }
    }
}

